Altmünster) den 1. Platz sichern. Weitere<br>Platzierungen : 2.Pl. Felix Neuhuber (Sport-Union Altmünster); 3.Pl. Bachmayer Tobias (ATV-Andorf)</p><p>Bei den U15 DE siegte ebenfalls Hanna Neuhuber (Sport-Union Altmünster), ebenfalls Neueinsteigerin. Weitere<br>Platzierungen: 2.Pl. Babette Mayer (Sport-Union Atmünster); 3.Pl. Marlene Stein (Sport-Union Altmünster); 4.Pl. Viktoria Feitzlmayr (ATV-Andorf)</p><p><em>Zum Abschluss des Turniers gab es auch noch eine Tombola.<br>Auf Grund der sommerlichen Temperaturen wurden alle Spieler/innen mit einem Eis belohnt.</em></p><p><strong>[Bericht: Peter Kickinger]</strong></p>', '2018-08-14', 'data:image/png;base64,');

